                	Kantai Collection (艦隊これくしょん), also known as KanColle (艦これ), is an online browser game in which one assumes the role of an admiral, assembles a fleet of kanmusu ('ship girls' based on World War II-era ships and submarines), and battles against fleets of unknown warships.

This wiki is a place to find English information about the game & tutorials on how to play even without knowledge of Japanese. Additionally, information regarding the expanded franchise may be found, including manga, anime, other games, music, & more.







